const fakeQrValidator = (errorMessage,shouldReject) => {
    return new Promise( (res, reject) => {
        setTimeout( () => {
            if(shouldReject){
                reject(`error from server ${errorMessage}`)
            }
            res(` successfull: update`)
        } , 3000)
    } )
}

export { fakeQrValidator }
